import React from "react";
import { getSummaryData } from "./SingleMeetingAnalysisUtils";

export const SingleMeetupSummary = ({ attendees }: { attendees: any[] }) => {
  const summary = getSummaryData(attendees);

  return (
    <div>
      <h2>Summary of Meetup</h2>
    </div>
  );
};
